import React from "react";
import Ripple from "@bit/joshk.react-spinners-css.ripple";
export default function Test() {
  return (
    <div>
      <Ripple
        style={{
          display: "flex",
          alignItems: "center",
          textAlign: "center",
        }}
        color="#be97e8"
      />
    </div>
  );
}
